import React from "react";
import S from "./Card.module.css";
import img from '../../img/background.jpg'

function Card({ name, height, weight,life_span }) {
  return (
    <div className={S.container}>
      <h4>{name}</h4>
      <div className={S.row}>
        <p>height :</p>
        <p>{height}</p>
        <p> weight :</p>
        <p>{weight}</p>
      </div>
      <p>`Life Span: 5 years`</p>
      <img src={img} alt="img" className={S.img} />
    </div>
  );
}
export default Card;
